*
 * @class Deceleration - simple animation
 *    - an animation that mimic natrual slow down during scrolling
 * @example
 * new Deceleration({
 *  velocity: 1,
 *  onStep: (movement) => {
 *    console.log(movement)
 *  },
 *  onEnd: () => {
 *    console.log('deceleration end')
 *  }
 * })

